import React from 'react';

const Testimonials = () => {
  return (
    <section className="p-8">
      <h2 className="text-xl font-semibold mb-4">Testimonials</h2>
      <div className="slider flex space-x-4 overflow-x-auto">
        <div className="testimonial w-1/3 bg-gray-100 p-4 shadow-md transition-transform transform hover:scale-105">
          <p>"Great service!"</p>
          <span>- Customer 1</span>
        </div>
        <div className="testimonial w-1/3 bg-gray-100 p-4 shadow-md transition-transform transform hover:scale-105">
          <p>"Very satisfied!"</p>
          <span>- Customer 2</span>
        </div>
        <div className="testimonial w-1/3 bg-gray-100 p-4 shadow-md transition-transform transform hover:scale-105">
          <p>"Highly recommend!"</p>
          <span>- Customer 3</span>
        </div>
      </div>
    </section>
  );
};

export default Testimonials;
